        _ ->
            case Key band 7 of
                0 -> skip_varint_Events(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                1 -> skip_64_Events(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
